import * as types from "./actionTypes";

export function requestSignIn() {
  return {
    type: types.AUTH_SIGNIN_PENDING
  };
}

export function signIn(authToken) {
  return {
    type: types.AUTH_SIGNIN_SUCCEEDED,
    payload: authToken
  };
}
